			<br/>
			<input id="title" type="text" palceholder="title" />
			<label for="description" >Description</label>
			<br/>
			<textarea type="text" id="description" palceholder="Description"></textarea>
			</div>
		) : null}
		</React.Fragment>
		)
}

export default MovieForm;
